import { Repeat } from '@mui/icons-material'
import RepeatIcon from '@mui/icons-material/Repeat';
import { Avatar, Button } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import React from 'react'

const TweetCard = () => {
    const navigate = useNavigate();
    return (
        <div className=''>
            {/* <div className='flex items-center font-semibold text-gray-700 py-2'>
                <Repeat />
                <p>your retweet</p>
                
            </div> */}
            <div className="flex space-x-5">
                <Avatar className='cursor-pointer' onClick={() => navigate(`/profile/${6}`)}
                    img="https://www.vectorstock.com/royalty-free-vectors/profile-logo-vectors" alt="https://www.vectorstock.com/royalty-free-vectors/profile-logo-vectors" />
                <div className="w-full">
                    <div className="flex justify-between items-center">
                        <div className="flex cursor-pointer space-x-2 \">
                            <span className='font-semibold'>Username name</span>
                            <span className='text-gray-600'>Username .2m</span>
                            <img className='ml-2 w-5 h-5' src='https://www.google.com/imgres?imgurl=https%3A%2F%2Ftop4smm.com%2Fblog%2Fwp-content%2Fuploads%2F2022%2F04%2F53144321432.png&tbnid=Cnd-PK2vmkdCoM&vet=12ahUKEwixtJ6OjbGIAxXtimMGHbZYOdsQMygEegQIARBm..i&imgrefurl=https%3A%2F%2Ftop4smm.com%2Fblog%2Fhow-to-get-verified-on-instagram%2F&docid=-5FWrNfqwOm7PM&w=602&h=606&q=verification&hl=en-US&ved=2ahUKEwixtJ6OjbGIAxXtimMGHbZYOdsQMygEegQIARBm' /> </div>

                    </div>
                </div>

            </div>
        </div>

    )
}

export default TweetCard
